```gd
extends KinematicBody

var velocity = Vector3()
var gravity = 9.8
var speed = 10
var mouse_sensitivity = 0.2

func _input(event):
	if event is InputEventMouseMotion:
		rotation.y -= event.relative.x * mouse_sensitivity
		rotation.x = clamp(rotation.x - event.relative.y * mouse_sensitivity, -1.6, 1.6)

func _physics_process(delta):
	velocity.y -= gravity * delta
	velocity = move_and_slide(velocity)

func _unhandled_input(event):
	if event is InputEventKey and event.pressed and event.scancode == KEY_W:
		velocity.z = speed
	elif event is InputEventKey and event.pressed and event.scancode == KEY_S:
		velocity.z = -speed
	elif event is InputEventKey and event.pressed and event.scancode == KEY_A:
		velocity.x = -speed
	elif event is InputEventKey and event.pressed and event.scancode == KEY_D:
		velocity.x = speed
